  """
  This function flattens a nested list structure.

  Args:
    nested_list: A list that can contain nested lists.

  Returns:
    A flattened list containing all the elements from the input list in a single dimension.

  Raises:
    TypeError: If any element in the list is not of a valid type for concatenation.
  """
  flat_list = []
  for item in nested_list:
    if isinstance(item, list):
      try:
        for sub_item in item:
          if isinstance(sub_item, (int, float)):
            flat_list.append(sub_item)
          else:
            raise TypeError("Non-numeric elements interfere with desired output.")
